import "./App.css";
import Footer from "./footer.js";
import Header from "./header.js";
import Arows from "./arows.js";
import { Route, Routes } from "react-router-dom";

import Panel from "./panel.js";
import Sketch1 from "./sketches/Sketch1";
import Sketch2 from "./sketches/Sketch2";
import Sketch3 from "./sketches/Sketch3";
import Sketch4 from "./sketches/Sketch4";
import Sketch5 from "./sketches/Sketch5";
import NotFound from "./NotFound";

function App() {
  return (
    <>
      <Arows />
      <Header />
      <Routes>
        <Route path="/" element={<Panel />} />
        <Route path="/sketch-01" element={<Sketch1 />} />
        <Route path="/sketch-02" element={<Sketch2 />} />
        <Route path="/sketch-03" element={<Sketch3 />} />
        <Route path="/sketch-04" element={<Sketch4 />} />
        <Route path="/sketch-05" element={<Sketch5 />} />
        <Route path="/*" element={<NotFound />} />
      </Routes>

      <Footer />
    </>
  );
}

export default App;
